import { useEffect, useState} from "react"

export default function ProdactList(){

    const [product, setProducts] = useState([])

    useEffect(() =>{
        fetch('https://dummyjson.com/products')
            .then(res => res.json())
            .then(data => setProducts(data.product))
    }, [])

    return(
        <div>

            {product.map(elem => 
                <div key={elem.id}>
                    <h4></h4>{elem.title}
                </div>)}
        </div>
    )
}
